styles:
.breadcrumb {
  float: right;
  background: transparent;
  margin-top: 0;
  margin-bottom: 0;
  font-size: 12px;
  padding: 7px 5px;
  position: absolute;
  top: 15px;
  right: 10px;
  border-radius: 2px;
}

.breadcrumb > li > a {
  color: #444;
  text-decoration: none;
  display: inline-block;
}

.breadcrumb > li > a > .fa,
.breadcrumb > li > a > .glyphicon,
.breadcrumb > li > a > .ion {
  margin-right: 5px;
}

:host {
  display: block;
}

.sidebar-right-toggle {
  float: right;
}

.sidebar-right-toggle a {
  padding: 15px;
  display: block;
  line-height: 20px;
  cursor: pointer;
}

.main-sidebar {
  overflow: hidden;
}

.treeview-menu.collapse {
  display: none;
}

.treeview-menu,
.treeview-menu.collapse.in {
  display: block;
}

:host {
  display: block;
}

:host /deep/ .sidebar-right-toggle > a {
  color: #fff;
}

:host /deep/ .sidebar-right-toggle > a:hover {
  background: rgba(0, 0, 0, 0.1);
}

:host.skin-black /deep/ .sidebar-right-toggle > a,
:host.skin-black-light /deep/ .sidebar-right-toggle > a {
  color: #333;
  border-right-width: 0;
}

:host.skin-black /deep/ .sidebar-right-toggle > a:hover,
:host.skin-black-light /deep/ .sidebar-right-toggle > a:hover {
  background-color: #fff;
  color: #999;
}

:host.skin-black /deep/ .sidebar-right-toggle > a {
  border-left: 1px solid #eee;
}

:host.skin-black-light /deep/ .sidebar-right-toggle > a {
  border-left: 1px solid #d2d6de;
}

.callout-dismissable,
.callout-dismissible {
  padding-right: 35px;
}

.callout-dismissable .close,
.callout-dismissible .close {
    position: relative;
    top: -2px;
    right: -21px;
    color: inherit;
}

.callout .close {
  color: #000;
  opacity: 0.2;
  filter: alpha(opacity=20);
}

.callout .icon {
  margin-right: 10px;
}

.box.collapsed-box .box-body,
.box.collapsed-box .box-footer {
  display: inherit;
}

.box-solid {
  border: 1px solid;
}

.box-body {
  background-color: #fff;
}

.box.box-solid.bg-color > .box-header {
  color: #fff;
}

.small-box.bg-color {
  color: #fff;
}

/deep/ .small-box-footer:hover {
  cursor: pointer;
}

/deep/ .small-box-footer a {
  color: rgba(255,255,255,0.8);
}

/deep/ .small-box-footer:hover a{
  color: rgb(255,255,255);
}

.dropdown-menu {
  display: block;
}

.dropdown-menu.collapsing:not(.un-collapse) {
  -webkit-transition-property: height, padding-top, padding-bottom;
  transition-property: height, padding-top, padding-bottom;
  padding-top: 0;
  padding-bottom: 0;
}
